import { SET_YEAR } from "../actions/PageAction";

const initialState = {
  year: 2018,
  photos: [],
  isFetching: false
};

export function pageReducer(state = initialState, action) {
  switch (action.type) {
    case SET_YEAR:
      return { ...state, year: action.payload };

    default:
      return state;
  }
}
